import {getConecction} from "../database/database"

const getProd = async(req, res) => {
    try {
        const connection= await getConecction();
        const result = await connection.query("SELECT id, tipo_prod FROM producto");
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const postProd = async (req, res) => {
    try {
        const {id, tipo_prod} = req.body;
        
        if( id === undefined || tipo_prod === undefined ){
            res.status(400).json({ message: "Por favor llenar todos los campos"});
        }
        const product = {id, tipo_prod};
        const connection= await getConecction();
        await connection.query("INSERT INTO producto SET ?", product);
        res.json({message: "Producto ingresado"});
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const updateProd = async(req, res) => {
    try {
        const {id} = req.params;
        const {tipo_prod} = req.body;
        
        if(tipo_prod === undefined ){
            res.status(400).json({ message: "Por favor llenar todos los campos"});
        }

        const products = {tipo_prod};
        const connection= await getConecction();
        const result = await connection.query("UPDATE producto SET ? WHERE id = ?", [products, id]);
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

export const methods = {
    getProd,
    postProd,
    updateProd
};

