import {getConecction} from "../database/database"

const getPersons = async(req, res) => {
    try {
        const connection= await getConecction();
        const result = await connection.query("SELECT id, Nombre, fecha_inicio, cantidad, fecha_fin FROM ranking");
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const getPerson = async(req, res) => {
    try {
        const {id} = req.params;
        const connection= await getConecction();
        const result = await connection.query("SELECT id, nombre, telefono, correo, direccion, contraseña FROM persons WHERE id =?", id);
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const postPerson = async (req, res) => {
    try {
        const {nombre, telefono, correo, direccion, contraseña} = req.body;
        
        if(nombre === undefined || telefono === undefined || correo === undefined || direccion === undefined || contraseña === undefined){
            res.status(400).json({ message: "Por favor llenar todos los campos"});
        }
        const users = {nombre, telefono, correo, direccion, contraseña};
        const connection= await getConecction();
        await connection.query("INSERT INTO persons SET ?", users);
        res.json({message: "Usuario ingresado"});
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const updatePerson = async(req, res) => {
    try {
        const {id} = req.params;
        const {nombre, telefono, correo, direccion, contraseña} = req.body;
        
        if(id === undefined || nombre === undefined || telefono === undefined || correo === undefined || direccion === undefined || contraseña === undefined){
            res.status(400).json({ message: "Por favor llenar todos los campos"});
        }

        const users = {nombre, telefono, correo, direccion, contraseña};
        const connection= await getConecction();
        const result = await connection.query("UPDATE persons SET ? WHERE id = ?", [users, id]);
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

//EL ADMINISTRADOR ES EL UNICO QUE PODRA BORRAR USUARIOS
const deletePerson = async(req, res) => {
    try {
        const {id} = req.params;
        const connection= await getConecction();
        const result = await connection.query("DELETE FROM persons WHERE id =?", id);
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

export const methods = {
    getPersons,
    getPerson,
    postPerson,
    updatePerson, 
    deletePerson
};

