import {getConecction} from "../database/database"

const getEstado = async(req, res) => {
    try {
        const connection= await getConecction();
        const result = await connection.query("SELECT id, tipo_estado FROM estado");
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const postEstado = async (req, res) => {
    try {
        const {id, tipo_prod} = req.body;
        
        if( id === undefined || tipo_prod === undefined ){
            res.status(400).json({ message: "Por favor llenar todos los campos"});
        }
        const product = {id, tipo_prod};
        const connection= await getConecction();
        await connection.query("INSERT INTO estado SET ?", product);
        res.json({message: "Producto ingresado"});
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const updateEstado = async(req, res) => {
    try {
        const {id} = req.params;
        const {tipo_estado} = req.body;
        
        if(tipo_estado === undefined ){
            res.status(400).json({ message: "Por favor llenar todos los campos"});
        }

        const estado = {tipo_estado};
        const connection= await getConecction();
        const result = await connection.query("UPDATE estado SET ? WHERE id = ?", [estado, id]);
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

export const methods = {
    getEstado,
    postEstado,
    updateEstado
};

