import { Router } from "express";
import { methods as controller } from "../controllers/fechasController.js";

const routesF = Router();

routesF.get("/", controller.getFechas);
routesF.post("/", controller.postFecha);
routesF.put("/:id", controller.updateFecha);

export default routesF;

