import {getConecction} from "../database/database"

const getFechas = async(req, res) => {
    try {
        const connection= await getConecction();
        const result = await connection.query("SELECT id, fecha_inicio, fecha_fin FROM fecha_in_fin");
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const postFecha = async (req, res) => {
    try {
        const {fecha_inicio, fecha_fin} = req.body;
        
        if(fecha_inicio === undefined || fecha_fin === undefined){
            res.status(400).json({ message: "Por favor llenar todos los campos"});
        }
        const fecha = {fecha_inicio, fecha_fin};
        const connection= await getConecction();
        await connection.query("INSERT INTO fecha_in_fin SET ?", fecha);
        res.json({message: "Fecha ingresado"});
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

const updateFecha = async(req, res) => {
    try {
        const {id} = req.params;
        const {fecha_inicio, fecha_fin} = req.body;
        
        if(fecha_inicio === undefined || fecha_fin === undefined ){
            res.status(400).json({ message: "Por favor llenar todos los campos"});
        }

        const fecha = {fecha_inicio, fecha_fin};
        const connection= await getConecction();
        const result = await connection.query("UPDATE fecha_in_fin SET ? WHERE id = ?", [fecha, id]);
        res.json(result);   
    } catch (error) {
        res.status(500);
        res.send(error.message);  
    }
};

export const methods = {
    getFechas, 
    postFecha,
    updateFecha
};

